import React from 'react'
import ReactDOM from 'react-dom'

function Testreturn(){
    return(
        <div>
            <h1>React Testing</h1>
            <ol>
                <li>A</li>
                <li>B</li>
            </ol>
        </div>
    )
}

ReactDOM.render(<Testreturn />, document.getElementById("root"));
